 class MyCarousel extends React.Component {
    render() {
      return (    
      <Carousel>

        {CarouselJson.map(item=>{
          return(
            <CarouselItem myImagePath={item.imagePath}/>
          )
        }

        )}
          
        <CarouselItem myImagePath={image1}/>
        <CarouselItem myImagePath={image2}/>
